export default (function(a,b,c,d,e,f,g,h){return {data:{AOR32806sP:{data:{id:49,attributes:{imdbId:"tt0090585",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjNlZDQzODktMTUzNi00YWRjLTg2NmYtNDI5YTVhYzEwODY5XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"},{Source:"Metacritic",Value:"60\u002F100"}],item_lang:{data:{id:712,attributes:{title:c,plot:"A musical adaptation of Colin MacInnes' novel about life in late 1950s London. Nineteen-year-old photographer Colin is hopelessly in love with model Crepe Suzette, but her relationships are strictly connected with her progress in the fashion world. So Colin gets involved with a pop promoter and tries to crack the big time. Meanwhile, racial tension is brewing in Colin's Notting Hill housing estate...",slug:"absolute-beginners"}}},books:{data:[{id:1938,attributes:{title:c,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:1939,attributes:{title:c,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yR3tngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-08-11",publisher:a,subtitle:a}},{id:1940,attributes:{title:c,description:e,thumbnail:f,authors:[b],firstBook:d,published:g,publisher:h,subtitle:a}},{id:1941,attributes:{title:"The London Novels of Colin MacInnes",description:a,thumbnail:a,authors:[b],firstBook:d,published:"1969-01-01",publisher:a,subtitle:a}},{id:1942,attributes:{title:"The Colin MacInnes Omnibus",description:a,thumbnail:a,authors:[b],firstBook:d,published:"1985-01-01",publisher:a,subtitle:"His Three London Novels : City of Spades, Absolute Beginners, Mr Love and Justice"}}]}}},meta:{}}},prerenderedAt:1680940906836}}("","Colin MacInnes","Absolute Beginners",null,"‘I swore by Elvis and all the saints that this last teenage year of mine was going to be a real rave. Yes, man, come whatever, this last year of the teenage dream I was out for kicks and fantasy’ London, 1958. A new phenomenon is causing a stir: the teenager. In the smoky jazz clubs of Soho and the coffee bars of Notting Hill the young and the restless – the absolute beginners – are revolutionising youth culture and forging a new carefree lifestyle of sex, drugs and rock‘n’roll. Moving in the midst of this world of mods and rockers, Teddy gangs and trads., and snapping every scene with his trusty Rolleiflex, is MacInnes’ young photographer, whose unique wit and honest views remain the definitive account of London life in the 1950s and what it means to be a teenager. In this twentieth century cult classic, MacInnes captures the spirit of a generation and creates the style bible for anyone interested in Mod culture, and the changing face of London in the era of the first race riots and the lead up to the swinging Sixties...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JhqKAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-10-06","Allison & Busby"))